import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import '../reports/css/OrderDetails.css'; // Import the CSS file

const OrderDetails = () => {
  const { orderId } = useParams();
  const [orderDetails, setOrderDetails] = useState(null);
  const [orderItems, setOrderItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // In a real application, you would fetch data based on orderId
    // For now, we'll use dummy data and simulate a fetch
    const fetchOrderData = async () => {
      setLoading(true);
      try {
        // Simulate API call
        await new Promise(resolve => setTimeout(resolve, 500)); 

        // Dummy data - replace with actual API call
        const dummyOrderDetails = {
          orderId: orderId,
          customerMobile: '123-456-7890',
          orderTotal: '150.75',
          itemCount: 5,
          paymentMode: 'Credit Card',
          orderStatus: 'Completed',
        };

        const dummyOrderItems = [
          { product: 'Laptop', quantity: 1, salePrice: '1200.00', brand: 'Dell', type: 'Electronics' },
          { product: 'Mouse', quantity: 2, salePrice: '25.00', brand: 'Logitech', type: 'Electronics' },
          { product: 'Keyboard', quantity: 1, salePrice: '75.00', brand: 'Razer', type: 'Electronics' },
        ];

        setOrderDetails(dummyOrderDetails);
        setOrderItems(dummyOrderItems);
      } catch (err) {
        setError('Failed to fetch order details.');
        console.error('Error fetching order details:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchOrderData();
  }, [orderId]);

  if (loading) {
    return <div className="order-details-container">Loading order details...</div>;
  }

  if (error) {
    return <div className="order-details-container" style={{ color: 'red' }}>{error}</div>;
  }

  if (!orderDetails) {
    return <div className="order-details-container">No order details found.</div>;
  }

  return (
    <div className="order-details-container">
      <h2>Order Details for Order ID: {orderId}</h2>

      <div className="order-details-grid">
        <div className="detail-item">
          <strong>Order ID:</strong> {orderDetails.orderId}
        </div>
        <div className="detail-item">
          <strong>Customer Mobile:</strong> {orderDetails.customerMobile}
        </div>
        <div className="detail-item">
          <strong>Order Total:</strong> ${orderDetails.orderTotal}
        </div>
        <div className="detail-item">
          <strong>Item Count:</strong> {orderDetails.itemCount}
        </div>
        <div className="detail-item">
          <strong>Payment Mode:</strong> {orderDetails.paymentMode}
        </div>
        <div className="detail-item">
          <strong>Order Status:</strong> {orderDetails.orderStatus}
        </div>
      </div>

      <h3>Order Items</h3>
      <table className="order-items-table">
        <thead>
          <tr>
            <th>Product</th>
            <th>Quantity</th>
            <th>Sale Price</th>
            <th>Brand</th>
            <th>Type</th>
          </tr>
        </thead>
        <tbody>
          {orderItems.map((item, index) => (
            <tr key={index}>
              <td>{item.product}</td>
              <td>{item.quantity}</td>
              <td>${item.salePrice}</td>
              <td>{item.brand}</td>
              <td>{item.type}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OrderDetails;
